import logo from '../images/logo.png'
import '.././App.css'
function Home() {
  return (
    <div className="hmain">
<div class="marquee">
  <span>Welcome to my website! This is a scrolling text.</span>
</div>
      <img src={logo} alt="Homelogo" />
    </div>
  );
}

export default Home;
